import React from 'react';
import Question from "./Question"
import Grid from "@material-ui/core/Grid";


function Questions({questions, upPost, index}) {
    //const questions = props.questions;

    const questionTest = questions.map(((q, index) => {
        return (
            <li
                key={index}
                questions={q}
            >

            </li>
        )
    }));

    return (
            <Question
                key={index}
                questions={q}
                index={index}
                upPost={upPost}
            >
                {questionTest}
            </Question>

    )
}

export default Questions;
